<template>
  <ion-content class="no-padding">

    <ion-card color="success" mode="ios">
      <ion-card-content>

        <img
            src="data:image/png;base64,"
            style="position: absolute">

        <ion-row>
          <ion-col size="8">
            <small>Target/Contributed</small>
          </ion-col>
          <ion-col size="4">
            <ion-button :disabled="Number(wedding.contributions_sum_amount)==0" class="ion-align-self-end" color="light"
                        mode="ios" size="small" style="place-self: end !important;" @click="verifyDialog=true">
              Withdraw
              <ion-icon :icon="walletOutline" style="margin-left: 5px"></ion-icon>
            </ion-button>

          </ion-col>
        </ion-row>

        <h2 style="font-weight: bolder">
          {{ user.currency }}{{ !wedding ? 0 : Number(wedding.items_sum_target_amount) }}/{{ user.currency }}{{
            !wedding ? 0 : Number(wedding.contributions_sum_amount)
          }}
        </h2>
        <ion-progress-bar
            :value="percent"
            color="light"
            mode="ios"
            style="height: 10px; border-radius: 5px"></ion-progress-bar>
      </ion-card-content>

    </ion-card>


    <contribution-list :wedding="wedding" @createNew="newItem=true"></contribution-list>


    <ion-modal
        ref="withdrawModal"
        :breakpoints="[0,0.8,1]"
        :initial-breakpoint="initState"
        :is-open="verifyDialog"
        :swipeToClose="true"
        mode="ios"
        @willDismiss="verifyDialog=false;"
        class="no-padding"
    >
      <ion-header>
        <ion-toolbar>
          <ion-title>Withdraw Gift</ion-title>
          <ion-button slot="end" color="medium" fill="clear" size="small" @click="dismissWithdrawDailog">Cancel
          </ion-button>
        </ion-toolbar>
      </ion-header>

      <with-draw-component :currency="user.currency" :wedding-i-d="weddingID" @done="dismissWithdrawDailog" @expand="initState=1"></with-draw-component>

    </ion-modal>


    <ion-modal
        ref="itemModal"
        :breakpoints="[0,0.5,0.7]"
        :initial-breakpoint="initState"
        :is-open="newItem"
        :swipeToClose="true"
        mode="ios"
        @willDismiss="newItem=false;"
    >
      <new-wish-list-item
          :wedding-i-d="weddingID"
          @canceled="newItem=false"
          @itemSaved="itemWasCreated"
          @stepUp="stepUp"></new-wish-list-item>

    </ion-modal>

  </ion-content>

</template>

<script>
import {addOutline, giftOutline, walletOutline} from "ionicons/icons";

import NewWishListItem from "@/components/newWishListItem";
import {
  IonButton,
  IonCard,
  IonCardContent,
  IonCol,
  IonContent,
  IonHeader,
  IonIcon,
  IonModal,
  IonProgressBar,
  IonRow,
  IonTitle,
  IonToolbar
} from "@ionic/vue";

import ContributionList from "@/components/contributionList";
import WithDrawComponent from "@/components/withDrawComponent";


export default {
  props: {
    wedding: {
      type: Object
    },
    weddingID: {
      type: Number
    }
  },
  name: "CashTargetComponent",
  data() {
    return {
      addOutline,
      initState: 0.8,
      newItem: false,
      defaultSegment: '1d',
      giftOutline,
      walletOutline,
      loading: false,
      verifyDialog: false,
      items: [],
      series: [{
        name: "Contribution",
        data: [2000, 3000, 1000, 400, 20, 5000, 7000]
      }],
      chartOptions: {

        grid: {
          show: false
        },
        theme: {
          mode: 'light',
          palette: 'palette5',
          monochrome: {
            enabled: false,
            color: '#255aee',
            shadeTo: 'light',
            shadeIntensity: 0.65
          },
        },
        chart: {
          toolbar: {
            show: false
          },
          type: 'area',
          zoom: {
            enabled: false
          }
        },
        dataLabels: {
          enabled: false
        },
        stroke: {
          curve: 'smooth'
        },

        labels: ["7AM", "9AM", "10AM", "11AM", "1PM", "2PM", "3PM"],
        xaxis: {
          type: 'text',

        },
        yaxis: {
          show: false,

        },
        legend: {
          show: false
        }
      },


    }
  },
  computed: {
    user() {
      return this.$store.state.user;
    },
    percent() {

      if (!this.wedding) {
        return 0;

      }
      if (this.wedding.contributions_sum_amount <= 0) {
        return 0;
      }

      return this.wedding.contributions_sum_amount / this.wedding.items_sum_target_amount;

    },


    filterName() {
      if (this.defaultSegment == "1d") {
        return "1 Day"

      }

      if (this.defaultSegment == "1m") {
        return "1 Month"

      }

      if (this.defaultSegment == "6m") {
        return "6 Months"

      }

      if (this.defaultSegment == "max") {
        return "All time"

      }

      return "All time"


    }
  },
  methods: {

    dismissWithdrawDailog() {
      this.$refs.withdrawModal.$el.dismiss(null,"cancel");

    },
    stepUp(state) {

      this.$refs.itemModal.$el.setCurrentBreakpoint(state)
    },
    itemWasCreated(item) {

      this.newItem = false;
      this.$emit("cashAdded");
    }
  },

  components: {
    WithDrawComponent,
    ContributionList,
    IonContent,
    IonProgressBar,
    IonModal,
    NewWishListItem,
    IonCard,
    IonCardContent,
    IonButton,
    IonIcon,
    IonRow, IonCol
    , IonHeader, IonTitle, IonToolbar

  },
}
</script>

